import { default as React } from 'react';

import { MainNavigation, Problem, NextLeft } from '../components'

import './layouts.scss';

const TutorialLayout = ({children}) => {
  return (
    <div className="tutorial">
      <MainNavigation />
      <Problem />
  		<div className="tutorial__main">
  			{children}
  		</div>
    </div>
  );
};

export default TutorialLayout;
